bool load_textures()
{
    return (
            load_texture(&textures[0], brick_data, sizeof(brick_data)) &&
            load_texture(&textures[1], stone_data, sizeof(stone_data)) &&
            load_texture(&textures[2], steel_data, sizeof(steel_data))
    );
}

void unload_textures()
{
    for (int i = 0; i < 3; i++) {
        if (textures[i] != NULL) {
            SDL_FreeSurface(textures[i]);
        }
    }
}

static bool load_texture(SDL_Surface** surface, const uint8_t* data, size_t size)
{
    SDL_RWops* stream = SDL_RWFromConstMem(data, size);
    if (!stream) {
        SDL_ShowSimpleMessageBox(SDL_MESSAGEBOX_ERROR, "Error", SDL_GetError(), NULL);
        return false;
    }

    *surface = SDL_LoadBMP_RW(stream, 1);
    if (*surface == NULL) {
        SDL_ShowSimpleMessageBox(SDL_MESSAGEBOX_ERROR, "Error", SDL_GetError(), NULL);
        return false;
    }

    if ((*surface)->w != TEXTURE_SIZE || (*surface)->h != TEXTURE_SIZE) {
        SDL_ShowSimpleMessageBox(SDL_MESSAGEBOX_ERROR, "Error", "Textures must be 32x32", NULL);
        return false;
    }

    return true;
}